monxin_sql_startDROP TABLE IF EXISTS `monxin_distribution_distributor`;m;o;n;
CREATE TABLE `monxin_distribution_distributor` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) NOT NULL COMMENT '用户名',
  `phone` varchar(11) NOT NULL COMMENT '手机号',
  `superior` varchar(30) DEFAULT NULL COMMENT '上级',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '加入时间',
  `sum_money` decimal(22,2) NOT NULL DEFAULT '0.00' COMMENT '总业绩',
  `earn` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '累计佣金',
  `subordinate` int(11) NOT NULL DEFAULT '0' COMMENT '下级数量',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '状态0待审核 1审核通过 2已禁用',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='分销商表';m;o;n;
DROP TABLE IF EXISTS `monxin_distribution_order`;m;o;n;
CREATE TABLE `monxin_distribution_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `order_id` int(11) NOT NULL DEFAULT '0',
  `out_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '订单外显订单号',
  `buyer` varchar(30) DEFAULT NULL COMMENT '买家',
  `add_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '付款时间',
  `success_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '交易成功时间',
  `u_1` varchar(30) DEFAULT NULL COMMENT '一级分销商',
  `u_2` varchar(30) DEFAULT NULL COMMENT '二级分销商',
  `u_3` varchar(30) DEFAULT NULL COMMENT '三级分销商',
  `u_4` varchar(30) DEFAULT NULL COMMENT '四级分销商',
  `u_5` varchar(30) DEFAULT NULL COMMENT '五级分销商',
  `u_6` varchar(30) DEFAULT NULL COMMENT '六级分销商',
  `u_7` varchar(30) DEFAULT NULL COMMENT '七级分销商',
  `u_8` varchar(30) DEFAULT NULL COMMENT '八级分销商',
  `u_9` varchar(30) DEFAULT NULL COMMENT '九级分销商',
  `r_1` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '一级分销佣金',
  `r_2` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '二级分销佣金',
  `r_3` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '三级分销佣金',
  `r_4` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '四级分销佣金',
  `r_5` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '五级分销佣金',
  `r_6` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '六级分销佣金',
  `r_7` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '七级分销佣金',
  `r_8` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '八级分销佣金',
  `r_9` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '九级分销佣金',
  `distributor_id` int(11) NOT NULL DEFAULT '0' COMMENT '分销商ID',
  `order_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `order_state` int(1) NOT NULL DEFAULT '0' COMMENT '订单状态 参考本语言数组  order_state',
  `shop_rate` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '此单扣店主费用',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `buyer` (`buyer`)
) ENGINE=MyISAM AUTO_INCREMENT=114 DEFAULT CHARSET=utf8 COMMENT='分销订单';m;o;n;
monxin_sql_end